<script lang="ts">
import Matter, {
    Engine,
    Render,
    World,
    Runner,
    Bodies,
    Composite,
    Events,
    Body,
} from "matter-js";
import * as PIXI from "pixi.js";
import { gsap } from "gsap";
import { CustomEase } from "gsap/CustomEase";
import { MotionPathPlugin } from "gsap/MotionPathPlugin.js";

const SCENE_SCALE = 1.5;

export default {
    data() {
        gsap.registerPlugin(MotionPathPlugin);
        gsap.registerPlugin(CustomEase);
        return {
            worldWidth: 800,
            startPins: 3,
            pinLines: 14,
            pinSize: 1 * SCENE_SCALE,
            pinGap: 15 * SCENE_SCALE,
            ballSize: 4 * SCENE_SCALE,
            ballElastity: 1,
            engine: null,
            world: null,
            pins: [],
            lines: [],
            balls: []
        };
    },

    setup(props) { },

    methods: {
        setEnvironmentAccordingToSimulation(index) {
            this.destroyed = false;
            this.ballsDropped = 0;
            this.ballPositions = [];
            this.dropBallsArr = [];
            this.numberOfrow = 9 + index;
            this.numberOfColsInitial = 3;
            this.ballDistance = 512 / this.numberOfrow;
            this.ballSize = 7 + (16 - this.numberOfrow) / 2.5;
            this.ballSizeEnv = 5 + (16 - this.numberOfrow) / 2.5;
            this.createEnvironmentBlocks(this.numberOfrow, this.numberOfColsInitial, this.ballSize, [100, 200]);
            this.createBoundary();
            // this.DecodeInputData();
        },

        ChangeLine(e) {
            if (e.target.options.selectedIndex > -1) {
                this.currentGameIndex = Number(e.target.options[e.target.options.selectedIndex]._value) - 9;
            }
            this.destroyAllAndCreateNew();
            // this.setEnvironmentAccordingToSimulation(this.currentGameIndex);
        },

        DecodeInputData() {
            let currentConfiguration = this.configurationData[this.currentGameIndex];
            let numberOfBalls = 10;
            let finalPosArr = []
            for (let i = 0; i <= numberOfBalls; i++) {
                finalPosArr.push(7);
            }


            let index = 0;
            let ctr = 0;
            this.dropBallsArr = [];
            this.lastIndex = 0;
            let xPosArr = [];
            for (let i = 0; i < numberOfBalls; i++) {
                let reqConfig = currentConfiguration[finalPosArr[i]];
                let inputIndex = Math.floor(Math.random() * reqConfig.length);
                xPosArr.push(reqConfig[inputIndex]);
                let ballDropTimeOut = setTimeout(() => {
                    this.createdropBall(index, xPosArr[index]);
                    index++;
                    this.lastIndex = index;
                    clearTimeout(ballDropTimeOut);
                }, 500 * ctr, this);
                ctr++;
            }
        },

        simulation() {
            let xInitial = this.ballPositions[0][0].x + this.ballSize;
            let xLast = this.ballPositions[0][2].x - this.ballSize;
            let xPosArr = [];
            let index = 0;
            this.dropBallsArr = [];
            this.lastIndex = 0;
            for (let xPos = xInitial; xPos <= xLast; xPos += 0.1) {
                xPosArr.push(xPos);
                let ballDropTimeOut = setTimeout(() => {
                    this.createdropBall(index, xPosArr[index]);
                    index++;
                    clearTimeout(ballDropTimeOut);
                    this.lastIndex = index;
                }, 3 * xPosArr.length, this);
            }
        },

        updatePos() {
            Matter.Engine.update(this.EngineObj);
            this.dropBallsArr.forEach((ball, index) => {
                ball.position = ball.body.position;
                if (ball.position.y > 490 && ball.visible) {
                    this.ballsDropped++;
                    ball.visible = false;
                    let finalIndex = Math.floor((ball.position.x - this.ballPositions[this.numberOfrow - 1][0].x) / this.ballDistance);
                    this.animateBottomMultiplier(ball, finalIndex);
                }
            });
        },

        animateBottomMultiplier(ball, index) {
            this.historyArr.push(this.multiplierText[index]);
            this.startMovingMultiplier();
            let _this = this;
            if (index < 0) {
                index = 0;
            }
            if (index > this.numberOfrow) {
                index = this.numberOfrow;
            }
            let animatedObj1 = this.bottomMultiplier[index];
            let animatedObj2 = this.multiplierText[index];
            animatedObj1.position.set(this.ballPositions[this.numberOfrow][index].x + this.ballDistance / 2 + this.ballSizeEnv + 2, this.ballPositions[this.numberOfrow][index].y - this.ballDistance / 2);
            animatedObj2.position.set(this.ballPositions[this.numberOfrow][index].x + this.ballDistance + this.ballSizeEnv - 5, this.ballPositions[this.numberOfrow][index].y - this.ballDistance / 2 + 7.5);

            let yPos1 = animatedObj1.y;
            let yPos2 = animatedObj2.y;

            let tween1 = gsap.to(animatedObj1.position, {
                duration: 0.2,
                x: animatedObj1.x,
                y: yPos1 + 10
            });
            tween1.play();
            tween1.eventCallback("onComplete", () => {
                let tween2 = gsap.to(animatedObj1.position, {
                    duration: 0.2,
                    x: animatedObj1.x,
                    y: yPos1
                });
                tween2.play();
            }, [], this);
            let tween3 = gsap.to(animatedObj2.position, {
                duration: 0.2,
                x: animatedObj2.x,
                y: yPos2 + 10
            });
            tween3.play();
            tween3.eventCallback("onComplete", () => {
                let tween4 = gsap.to(animatedObj2.position, {
                    duration: 0.2,
                    x: animatedObj2.x,
                    y: yPos2
                });
                tween4.play();
                tween4.eventCallback("onComplete", () => {
                    if (this.ballsDropped === _this.lastIndex && this.destroyed === false) {
                        _this.destroyAllAndCreateNew();
                    }
                });
            }, [], this);
        },

        createBottomMultiplier() {
            this.bottomMultiplier = [];
            this.multiplierText = [];
            for (let i = 0; i <= this.numberOfrow; i++) {
                this.bottomMultiplier[i] = new PIXI.Graphics();
                this.bottomMultiplier[i].beginFill(0xFFA500, 1).drawRoundedRect(0, 0, this.ballDistance - 3, 30, 10);
                this.bottomMultiplier[i].position.set(this.ballPositions[this.numberOfrow][i].x + this.ballDistance / 2 + this.ballSizeEnv + 2, this.ballPositions[this.numberOfrow][i].y - this.ballDistance / 2);
                this.bottomMultiplier[i].pivot.set(this.ballSizeEnv, this.ballSizeEnv);
                this.multiplierText[i] = new PIXI.Text("", {
                    fontSize: 12,
                    align: "right",
                    lineHeight: 30,
                    fontWeight: 'bold',
                    wordWrapWidth: this.ballDistance,
                    fill: ['#000000']
                });
                console.log(this.multiplierText[i].width);
                this.multiplierText[i].text = i;
                this.multiplierText[i].anchor.set(0.5);

                this.multiplierText[i].position.set(this.ballPositions[this.numberOfrow][i].x + this.ballDistance + this.ballSizeEnv - 5, this.ballPositions[this.numberOfrow][i].y - this.ballDistance / 2 + 7.5);
                this.mainContainer.addChild(this.bottomMultiplier[i]);
                this.mainContainer.addChild(this.multiplierText[i]);
            }
        },

        createEnvironmentBlocks(numberRows, starterColumns, filterArr) {
            this.cbbodies = [];
            this.ballPositions = [];
            let cols = starterColumns;
            let i = 0
            for (i = 0; i < numberRows; i++) {
                this.cbbodies[i] = [];
                this.ballPositions[i] = [];
                for (let j = 0; j < cols; j++) {
                    let offset = ((numberRows - i) * this.ballDistance) / 2;
                    let x = offset + this.ballDistance * j;
                    let y = i * this.ballDistance;
                    this.ballPositions[i][j] = { x: x, y: y };

                    this.cbbodies[i].push(new PIXI.Graphics());
                    this.cbbodies[i][j].body = Matter.Bodies.circle(x, y, this.ballSizeEnv, { collisionFilter: { category: 0x0001 }, isStatic: true, friction: 1, restitution: 1 });

                    Matter.World.add(this.WorldObject, this.cbbodies[i][j].body);
                    this.cbbodies[i][j].beginFill(0xffffff, 1).drawCircle(0, 0, this.ballSizeEnv).endFill();
                    this.cbbodies[i][j].position.set(x, y);
                    this.mainContainer.addChild(this.cbbodies[i][j]);
                }
                cols++;
            }
            this.ballPositions[i] = [];
            for (let j = 0; j < cols; j++) {
                let offset = ((numberRows - i) * this.ballDistance) / 2;
                let x = offset + this.ballDistance * j;
                let y = i * this.ballDistance;
                this.ballPositions[i][j] = { x: x, y: y };
            }
            this.createBottomMultiplier();
            this.resize();
        },

        createdropBall(i, xPos) {
            let x = this.ballPositions[0][1].x;
            let y = this.ballPositions[0][1].y;
            this.dropBallsArr.push(new PIXI.Graphics())
            this.dropBallsArr[i].beginFill(0xff0000, 1).drawCircle(0, 0, this.ballSize).endFill();
            this.mainContainer.addChild(this.dropBallsArr[i]);
            this.dropBallsArr[i].x = xPos;
            this.dropBallsArr[i].indexPos = i;
            this.dropBallsArr[i].y = y - 30;
            this.dropBallsArr[i].initialXpos = xPos;
            this.dropBallsArr[i].body = Matter.Bodies.circle(xPos, y - 30, this.ballSize, { collisionFilter: { category: 0x0002, mask: 0x0001 }, friction: 1, restitution: 1 });
            Matter.World.add(this.WorldObject, this.dropBallsArr[i].body);
        },

        createPath(finalPoint, filterArr, index, filterArrLines) {
            let path = [];

            let offset = 0;
            let x1 = offset + this.ballDistance * (finalPoint + 1) - 5;
            let y1 = this.numberOfrow * this.ballDistance;


            let offset2 = ((this.numberOfrow - 11) * this.ballDistance) / 2;
            let x2 = offset2 + this.ballDistance * (finalPoint) - 5;
            let y2 = (this.numberOfrow - 1) * this.ballDistance;

            let offset3 = ((this.numberOfrow - 11) * this.ballDistance) / 2;
            let x3 = offset2 + this.ballDistance * (finalPoint + 1) - 5;
            let y3 = (this.numberOfrow - 1) * this.ballDistance;


            let angle = Math.atan2(y2 - y1, x2 - x1);
            let angle2 = Math.atan2(y3 - y1, x3 - x1);

            let leftLine = new PIXI.Graphics();
            leftLine.beginFill(0xffffff, 1).drawRect(0, 0, 3000, 5);
            leftLine.position.set(x1, y1);
            leftLine.rotation = angle;
            let rightLine = new PIXI.Graphics();
            rightLine.beginFill(0xffffff, 1).drawRect(0, 0, 3000, 5);
            rightLine.position.set(x1, y1);
            rightLine.rotation = angle2;
            this.mainContainer.addChild(leftLine);
            this.mainContainer.addChild(rightLine);
            let leftRect = Matter.Bodies.rectangle(x1, y1, 3000, 5);
            let rightRect = Matter.Bodies.rectangle(x1, y1, 3000, 5);
            leftRect.collisionFilter.groupVal = filterArr[index];
            rightRect.collisionFilter.groupVal = filterArr[index];
            Matter.Body.rotate(leftRect, angle);
            Matter.Body.rotate(rightRect, angle2);
            Matter.World.add(this.WorldObject, leftRect);
            Matter.World.add(this.WorldObject, rightRect);
        },

        createBoundary() {
            let pos1 = this.ballPositions[0][0];
            let pos2 = this.ballPositions[this.numberOfrow - 1][0];
            let pos3 = this.ballPositions[this.numberOfrow - 1][this.numberOfrow + 1];
            let pos4 = this.ballPositions[0][2];

            let angle1 = Math.atan2(pos2.y - pos1.y, pos2.x - pos1.x);
            let angle2 = Math.atan2(pos3.y - pos4.y, pos3.x - pos4.x);

            let dist1 = Math.hypot(pos2.x - pos1.x, pos2.y - pos1.y)
            let dist2 = Math.hypot(pos4.x - pos3.x, pos4.y - pos3.y)


            let rect1 = Matter.Bodies.rectangle(pos1.x + Math.cos(angle1) * dist1 / 2, pos1.y + Math.sin(angle1) * dist1 / 2, dist1, 5, { collisionFilter: { category: 0x0001 }, isStatic: true, friction: 0, restitution: 1 });
            let rect2 = Matter.Bodies.rectangle(pos4.x - Math.cos(angle1) * dist1 / 2, pos4.y + Math.sin(angle1) * dist2 / 2, dist2, 5, { collisionFilter: { category: 0x0001 }, isStatic: true, friction: 0, restitution: 1 });
            let rect3 = Matter.Bodies.rectangle(pos2.x, pos2.y + this.ballDistance, 1000, 5, { collisionFilter: { category: 0x0001 }, isStatic: true, friction: 0, restitution: 1 });
            let rect4 = Matter.Bodies.rectangle(pos1.x, pos1.y - 40, 5, 40, { collisionFilter: { category: 0x0001 }, isStatic: true, friction: 0, restitution: 1 });
            let rect5 = Matter.Bodies.rectangle(pos4.x, pos4.y - 40, 5, 40, { collisionFilter: { category: 0x0001 }, isStatic: true, friction: 0, restitution: 1 });
            Matter.Body.rotate(rect1, angle1);
            Matter.Body.rotate(rect2, angle2);

            Matter.World.add(this.WorldObject, rect1);
            Matter.World.add(this.WorldObject, rect2);
            Matter.World.add(this.WorldObject, rect3);
            Matter.World.add(this.WorldObject, rect4);
            Matter.World.add(this.WorldObject, rect5);


        },

        destroyAllAndCreateNew() {
            this.destroyed = true;
            Matter.World.clear(this.WorldObject);
            this.mainContainer.removeChildren();
            let _this = this;
            _this.setEnvironmentAccordingToSimulation(this.currentGameIndex);
            // setTimeout(()=>{
            //     if(this.currentGameIndex<=6){
            //         _this.setEnvironmentAccordingToSimulation(++this.currentGameIndex);
            //     }
            //     else{
            //         console.log(JSON.stringify(_this.simulationData));
            //     }
            // },1000);
            // this.setEnvironmentAccordingToSimulation(++this.currentGameIndex);
        },

        hideBalls() {
            this.mainContainer.removeChildren();
        },


        createHistory() {
            this.historyComponent = [];
            let mask = new PIXI.Graphics();
            mask.beginFill(0xfff, 1).drawRoundedRect(0, 0, 50, 200, 20);
            mask.alpha = 0.5;
            mask.position.set(50, 50);


            for (let i = 0; i < 6; i++) {
                let rect = new PIXI.Graphics();
                rect.beginFill(0xFFA500, 1).drawRect(0, 0, 50, 50);
                rect.position.set(50, i * 50);

                let text = new PIXI.Text("25", {
                    fontSize: 18,
                    align: "right",
                    lineHeight: 30,
                    fontWeight: 'bold',
                    wordWrapWidth: this.ballDistance,
                    fill: ['#000']
                });
                text.anchor.set(0.5);
                text.position.set(50 + 25, i * 50 + 25);
                text.name = "history" + i;

                let rectborder = new PIXI.Graphics();
                rectborder.beginFill(0x000, 1).drawRect(0, 0, 45, 0.5);
                rectborder.position.set(50 + 2.5, i * 50);
                rectborder.name = "rectborder" + i;

                this.historyComponent[i] = { rect: rect, text: text, rectborder: rectborder };
                this.historyContainer.addChild(rect);
                this.historyContainer.addChild(text);
                this.historyContainer.addChild(rectborder);
            }
            this.historyContainer.addChild(mask);
            this.historyContainer.mask = mask;
        },

        startMovingMultiplier() {
            if (this.historyIndex < this.historyArr.length && !this.isHistoryMoving && this.historyArr[this.historyIndex]) {
                this.moveHistory(this.historyArr[this.historyIndex].text, 0);
            }
        },

        moveHistory(value, i) {
            this.isHistoryMoving = true;
            this.historyComponent[0] = this.historyComponent[5];

            this.historyComponent[0].rect.position.set(50, i * 50);
            this.historyComponent[0].text.position.set(50 + 25, i * 50 + 25);
            this.historyComponent[0].text.text = value;
            this.historyComponent[0].rectborder.position.set(50 + 2.5, i * 50);

            for (let i = 5; i > 0; i--) {
                this.historyComponent[i] = this.historyComponent[i - 1];
            }
            for (let i = 0; i < 6; i++) {
                this.moveHistoryDown(this.historyComponent[i].rect, 0, i);
                this.moveHistoryDown(this.historyComponent[i].text, 1, i);
                this.moveHistoryDown(this.historyComponent[i].rectborder, 2, i);
            }
        },


        moveHistoryDown(animObj, index, symbolIndex) {
            this.isHistoryMoving = true;
            let tween = gsap.to(animObj.position, {
                duration: 0.2,
                x: animObj.x,
                y: animObj.y + 50
            });
            tween.play();
            let _this = this;
            let timoutPlayHistory = setTimeout(() => {
                if (index === 2 && symbolIndex === 5) {
                    _this.isHistoryMoving = false;
                    _this.historyIndex++;
                    _this.startMovingMultiplier();
                    clearTimeout(timoutPlayHistory);
                }
            }, 210);
        },

        resize() {
            if (this.$refs.plinkoDiv.clientWidth < 540) {
                this.mainContainer.scale.set(0.65);
            }
            else {
                this.mainContainer.scale.set(1);
            }
            this.mainContainer.position.set((this.$refs.plinkoDiv.clientWidth - this.mainContainer.width) / 2, (this.$refs.plinkoDiv.clientHeight - this.mainContainer.height) / 2);
            this.historyContainer.position.set(this.$refs.plinkoDiv.clientWidth - 125, (this.$refs.plinkoDiv.clientHeight - this.historyContainer.height) / 2);
        }
    },

    mounted() {
        this.gameApp = new PIXI.Application({
            backgroundColor: 0x000000, antialias: true,
            resolution: 1
